import{ExcelDownloader}from"./excel-downloader.min.js";import{WorkExperienceRepository}from"../repository/work-experience-repository.min.js";class WorkExperienceExcelDownloader{download=async()=>{const o=(new WorkExperienceRepository).getAll();o.sort(((o,e)=>e.no<o.no));const e=[];e.push(["no","businessType","period-from","period-to","device","operatingSystem","programmingLanguage","developmentTool","framework","platform","database","uncategorizedTechnology","projectSummary","projectPeakSize","subordinate","system","task"]);for(const r of o){const o=[r.no,r.businessType,r.period.from,r.period.to,r.device.join(", "),r.os.join(", "),r.programmingLanguage.join(", "),r.developmentTool.join(", "),r.framework.join(", "),r.platform.join(", "),r.database.join(", "),r.uncategorizedTechnology.join(", "),r.projectSummary,r.projectPeakSize,r.subordinate,r.system,r.task.map((o=>o.name)).join(", ")];e.push(o)}const r=await ExcelDownloader.build();r.addAoaToWorkbook(e,"data"),r.download("work-experience")}}export{WorkExperienceExcelDownloader};